import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for search input and enter XSS payload
    await page.waitForSelector('#searchInput', { timeout: 5000 });
    await page.fill('#searchInput', '<script>alert("XSS")</script>');

    // Take screenshot after entering payload
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_xss_payload_entered.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_xss_payload_entered.png'));

    // Click search button using multiple selector strategies
    const searchBtn = await page.$('.search-btn');
    await searchBtn.click();

    // Wait for potential page changes and take final screenshot
    await page.waitForTimeout(1000);
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_after_search.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_after_search.png'));

    // Check if payload appears in page content
    const pageContent = await page.content();
    const payloadFound = pageContent.includes('<script>alert("XSS")</script>');

    return {
      success: true,
      action: "Attempted XSS injection via search input with payload: <script>alert('XSS')</script>",
      extractedData: {
        payloadInjected: true,
        payloadReflected: payloadFound,
        searchPerformed: true
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete XSS attempt via search input",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
